import React from 'react';
import { Typography, Link, makeStyles, Paper, Grid } from '@material-ui/core';
import { Assignment, Email, Phone, Home } from '@material-ui/icons';
import {Fade,Flip,Rotate,Zoom,Bounce,Slide,Roll,LightSpeed}  from 'react-reveal';


//Using custom styles
const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        maxWidth: "100%",
        textAlign: "center",
    }
}));
export default function ContactMe() {

    //Importing Hooks
    const classes = useStyles();

    return (
        <>
            <div className={classes.root}>
                <Paper className={classes.paper}>
                    <Grid item xs container spacing={3}>




                        <Grid item xs={12} md={12}>
                            <Typography variant="h5" >
                                Phone<Phone />: <Link variant="h5" > 0420719901</Link>
                            </Typography>

                        </Grid>
                        <Grid item xs={12} md={12}>
                            <Typography component="address" variant="h5" >
                                Address<Home /> : 4/10 Lurline Av, Gilles Plain South Australia
                            </Typography>
                        </Grid>
                    </Grid>
                </Paper>
            </div>

            <div>
                <h1>
                    <Fade bottom cascade> Contact.</Fade>
                </h1>
                <Fade bottom>
                    <div className='contact-content'>
                        <h1>
                            Let’s create your next<br></br>
                            <span className='amazing-color'>experience together</span></h1>
                            <Typography variant="h5" >
                                Phone<Phone />: <Link variant="" > 0420719901</Link>
                            </Typography>
                        <a href={`mailto:${"marasinipradeep@gmail.com"}`} className='email'>{"marasinipradeep@gmail.com"}</a>

                    </div>
                </Fade>

                <span className='footer'>Made With ❤ by <a href="https://pradeep-marasini.herokuapp.com/">Pradeep Marasini</a></span>
            </div>
        </>
    );
}
